import img2 from "./image/image1.jpg"
import img3 from "./image/image2.jpg"




const App = () => {
let dateCart = [
    {title: "HTML",discription: "Props are passed to components via HTML attributes.", img: img1},
   {title: "css",discription: "Props are passed to components via css attributes.", img: img1},
   {title: "js",discription: "Props are passed to components via js attributes.", img: img1},
]
    return (
      <div>
      <Navber></Navber>

      {
       
       dateCart.map((item) => {
         return (
           <CartDetails title={ item.title } discription={item.discription} image={item.i} />
         )
       })
        
      }

      </div>
    )

}

export default App;
